export function transformThreadMember(bot, payload) {
    const threadMember = {
        id: payload.id ? bot.transformers.snowflake(payload.id) : undefined,
        userId: payload.user_id ? bot.transformers.snowflake(payload.user_id) : undefined,
        joinTimestamp: Date.parse(payload.join_timestamp),
        flags: payload.flags,
    };
    return threadMember;
}
export function transformThreadMemberGuildCreate(bot, payload) {
    const threadMember = {
        joinTimestamp: Date.parse(payload.join_timestamp),
    };
    return threadMember;
}
